import React from 'react';

function DataTable({ data, search }) {
  return (
    <table className="schedule-table">
      <thead>
        <tr>
          <th>Days</th>
          <th>Time</th>
          <th>Event</th>
        </tr>
      </thead>
      <tbody>
        {data
          .filter((item) => {
            // Customize this filtering logic based on the structure of your data
            return (
              item.day.toLowerCase().includes(search.toLowerCase()) ||
              item.time.toLowerCase().includes(search.toLowerCase()) ||
              item.event.toLowerCase().includes(search.toLowerCase())
            );
          })
          .map((rowData, index) => (
            <tr key={index}>
              <td>{rowData.day}</td>
              <td>{rowData.time}</td>
              <td>{rowData.event}</td>
            </tr>
          ))}
      </tbody>
    </table>
  );
}

export default DataTable;
